import React,{useState} from 'react'
import Head from 'next/head'
import Link from 'next/link'
import Api from '../rotas/validar'
import Cookies from 'js-cookie'
import {Container,Conteudo,Bloco} from '../styles/stylesPage/loginStyles'
const [valor, setValor] = useState(
  {
    email: '',
    password: ''
  }
)
const OnSubmit = (e) => {
  e.preventDefault()
  const { name, value } = e.target
  setValor(prevState => ({
    ...prevState,
    [name]: value
  }))
}
const handleSubmitClick = (e) => {
  e.preventDefault()
//pega os dados e manda para o backend, caso esteja tudo certo
// entra no feed, caso contrário retorna uma mensagem de erro
  const data = {
    email: valor.email,
    password_hash: valor.password
  }
  console.log(valor)
  try {
    Api.post('/ver', data).then(function (response) {
      console.log(response.data.user.token)
      Cookies.set('Token', response.data.user.token)

    }).catch((err) => {
      console.log(err)
      alert("erro")
    })
  } catch (e) {
    alert("erro")
  }
}
const Home: React.FC =()=> {
  return (
    <div>
      <Head>
        <title>ha</title>

      </Head>

      <main >
       <Container>
         <Conteudo>
           <h2 className="text">Faça o seu login</h2>
           <form>
             <input type='text' placeholder="Email" onChange={OnSubmit} name="email" className="input"></input>
             <input type='text' placeholder="senha" onChange={OnSubmit} name="senha" className="input"></input>
             <button type='submit'  onClick={handleSubmitClick}>Entrar</button>
           </form>

              <Link href='/cadastro'>
              <a>Cadastro</a>
            </Link>
           </Conteudo>
           <Bloco>

           </Bloco>

      </Container>
      </main>


    </div>
  )
}
export default Home
